class Solution:
    def numTrap(self, m: int, x: int) -> int:
        n = m ** 2
        dp = [[0] * n for _ in range(m)]
        dp[0][0] = 1
        for i in range(m):
            for j in range(1, n):
                dp[i][j] = (dp[i - 1][j] + dp[i][j - 1] + dp[i - 1][j - 1] * x) % m
        return dp[m - 1][n - 1]


