class Solution:
    def longestPalindromeSubstring(self, s: str) -> int:

        # Empty string
        if len(s) < 2:
            return len(s)

        # Find the longest palindrome substring
        res = 0
        l = 0
        r = 0
        for r in range(len(s)):
            l = max(l, r-1)
            l += 1
            r = r+1
            while l < r:
                if s[l] == s[r]:
                    l += 1
                    r += 1
                else:
                    break
            if r-l-1 > res:
                res = r-l-1
        return res

