class Solution:
    def minSteps(self, grid: List[List[int]]) -> int:

        def dfs(x, y):
            # base case
            if x < 0 or y < 0 or x >= len(grid) or y >= len(grid[0]):
                return 0
            # recursive case
            if grid[x][y] == 0:
                return 0
            # keep a record of all the ways that this cell can be reached
            ways = []
            # add this cell to the ways array
            ways.append((x, y))
            # add this cell to the grid
            grid[x][y] = 0
            # call dfs on each neighbour
            ways = [dfs(x + 1, y) for x in [x - 1, x] for y in [y, y + 1]]
            # get the minimum
            return min(ways)

        return dfs(0, 0)

