        # DP[i][j] = min(DP[i][j], DP[i][j-3]+1, DP[i-2][j-3]+1, DP[i-1][j-3]+1, DP[i][j-3]+1)
        # DP[i][j] = max(DP[i][j], DP[i][j+3]+1, DP[i+2][j+3]+1, DP[i+1][j+3]+1, DP[i+2][j]+1)
        # DP[i][j] = min(DP[i][j], DP[i][j+1]+1, DP[i+1][j+1]+1)
        DP = [[0 for _ in range(n+1)] for _ in range(n+1)]
