import unittest


class Solution(object):
    def minimumCost(self, S):
        """
        :type S: str
        :rtype: int
        """
        n, ans = len(S), -1

        # initialize best string
        best = S[0]

        for i in range(1, n):
            if S[i] == S[i - 1]:
                if best[::-1] == S[i]:
                    ans = i
                    break
            if best[::-1]!= S[i]:
                best = S[i]
                ans = i

        for i in range(n - 1):
            if S[i]!= S[i + 1]:
                if best[::-1] == S[i] or best[::-1] == S[i + 1]:
                    ans = max(ans, i)
                else:
                    best = S[i]

        return ans


