class Solution:
    def FractionalPower(self, x: int, n: int) -> int:
        def compute(x: int, n: int) -> int:
            res = 1
            for i in range(2, min(int(n ** 0.5), n + 1) + 1):
                if n % i == 0:
                    res *= i
                    n //= i
            return res

        f = lambda a: compute(a, n) if n % a == 0 else compute(a, n) + a * (n // a)
        return f(x) % (10 ** 9 + 7)

