class Solution:
    def arrangeCoins(self, n: int) -> int:

        def solve(n, x):
            if n == 0:
                return x
            if n % 3 == 0:
                return x + solve(n//3, x)
            else:
                return x + solve(n//3, x) + solve(n//3 * (n%3), x)

        return solve(n, 1)

