class Solution:
    def findGreatestCommonDivisor(self, n: int, m: int) -> int:
        def get_divisors(m: int):
            divisors = [x for x in range(1, m+1)]
            for i in range(1, m+1):
                if m%i==0:
                    divisors.append(i)
            return divisors

        for i in range(n+1):
            temp = get_divisors(m)
            temp.sort()
            if len(temp)>0:
                m = temp[-1]
            else:
                m = 0
                break
        return m

